import React from 'react';
import { Link, Route, BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import History from './components/History';
import './styles.css';

function Header(){

    return(
        <Router>
            <img src="./images/logo.jpg" width="438" height="93" alt="" id="logo" /> <img src="./images/slogan.gif" width="190" height="81" alt="" id="slogan" />
            <ul class="menu">
            <li class="btn_1"><Link to={`/`}>home page</Link></li>
            <li class="line"></li>
            <li class="btn_2"><Link to={`/History`}>our history</Link></li>
            <li class="line"></li>
            <li class="btn_3"><a href="#">menu</a></li>      
            <li class="line"></li>
            <li class="btn_6"><a href="#">contacts</a></li>
            </ul>
            <div>
            <div id="root">
                <Route path="/" component={App}/>
                <Route path="/History" component={History}/>
            </div>
            </div>
            
        </Router>
    );
}

export default Header;
